define(["jquery"],function($){return slideshow={slideIndex:1,show:function(){slideshow.showSlides(slideshow.slideIndex);$(".slideshow-prev").click(function(){slideshow.plusSlides(-1)});$(".slideshow-next").click(function(){slideshow.plusSlides(1)});$(".slideshow-dot").click(function(){var num=$(this).attr("data-slidenun");slideshow.currentSlide(num)})},plusSlides:function(n){slideshow.showSlides(slideshow.slideIndex+=n)},currentSlide:function(n){slideshow.showSlides(slideshow.slideIndex=n)},showSlides:function(n){var i;var slides=document.getElementsByClassName("slideshow-item");var dots=document.getElementsByClassName("slideshow-dot");if(n>slides.length){slideshow.slideIndex=1}if(n<1){slideshow.slideIndex=slides.length}for(i=0;i<slides.length;i++){slides[i].style.display="none"}for(i=0;i<dots.length;i++){dots[i].className=dots[i].className.replace(" active","")}slides[slideshow.slideIndex-1].style.display="block";dots[slideshow.slideIndex-1].className+=" active"}}});